import React from 'react';

export default function Header() {
  return (
    <header className="w-full bg-gradient-to-r from-blue-800 via-blue-600 to-indigo-600 shadow-md py-4 px-8 flex items-center justify-between">
      <div className="flex items-center space-x-4">
        <svg xmlns="http://www.w3.org/2000/svg" className="h-8 w-8 text-white" fill="none" viewBox="0 0 24 24" stroke="currentColor"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 6l8 4-8 4-8-4 8-4zm0 8v6m0 0H6m6 0h6" /></svg>
        <span className="text-2xl font-extrabold tracking-wide text-white font-serif whitespace-nowrap">Chettinad College of Engineering and Technology</span>
      </div>
      <div className="hidden md:block text-white text-sm font-medium">Empowering Innovation</div>
    </header>
  );
}
